import axios from 'axios'

const baseUrl = 'http://localhost:3002/contact'

const contactSubmit = (userObj) => {
    axios.post(baseUrl, userObj)
        .then(response => {
            return response.data
        })
        .catch(err => console.log(err))
}

export { contactSubmit, }
